import { Routes, Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Registration from "./pages/Registration";
import NoPage from "./pages/NoPage";
import Nav from "./components/Nav";
import Protected from "./components/Protected";
import "./App.css";

function App() {
  const isLoggedIn = localStorage.getItem('loggedIn');
    return (
        <main>
          <div className="navigation">
            <Nav />
            </div>
            <div className="content">
            <Routes>
              <Route path="Login" element={<Login />} />
              <Route path="Registration" element={<Registration />} />

                <Route index element={<Protected isLoggedIn={isLoggedIn}><Home /></Protected>} />
                <Route path="Bookings" element={<Protected isLoggedIn={isLoggedIn}><Bookings /></Protected>} />
              <Route path="*" element={<Protected isLoggedIn={isLoggedIn}><NoPage /></Protected>} />

            </Routes>
            </div>
        </main>
    );
}

export default App;
